Top scholarship - Alumni Scholarship receipt

Published three papers, two of which were first-author paper during my work-study;

Named "Star Scholar" by "The World Scholar", a national magazine;

First in the class of over 50 to receive full-time job offer from a fortune 500 company, more than one year ahead of graduation;

Elected President of the Graduate and Professional Student Caucus (constituents consisted of 10,000+ graduate students);

Elected President of the Friendship Association of the Chinese Students and Scholars (2,000 members);

Elected President of the Gator International Soccer Club (100+ active members);

Won the Campus International Beauty Pageant;

Fund-raised over $20,000 to initiate the largest student-run Chinese culture show in North America - still going on annually;

Voted to receive the John Michael Stratton Award - Most Outstanding Student Senator Award presented to one student per semester, at a university of 50,000 students;

Selected as the first and only international student to serve the Matthews' Society, the top leadership recognition with membership limited to 12, at a university of 50,000 students.

Four years statistical modeling practice makes me 1) very familiar with SAS 2) very familiar with all details for developing a robust statistical model that solves business problem and can be explained 3) good sense of how pricing works in Insurance. Thanks Farmers for employing me during the economic crash.

Applied advanced statistical techniques like General Linear Regression (SAS GLM) and Decision Tree (CART and Treenet) to develop the real-time pricing predictive models for the Zurich Small Business Auto book (book of about $1B) during the merging of the Zurich Small Business and the Farmers Commercial Insurance. Model was a success and was implemented in 2009;

Oversaw the whole process of developing and implementing the real-time pricing model for the Farmers' Commercial Auto (Book of $400MM), include data gathering and validation, modeling discussion with all stockholders and talking with the IT team to guarantee correct implementation;

Lead the effort of managing an off-shore team in India to rate the incoming quotes with the proposed predictive model, and check the data quality and system performance. Identified several implementation errors that saved the company at least $500,000;

Developing and maintaining other predictive models for the pricing and marketing purpose using advanced statistical techniques, for the Farmers' Commercial Insurance book of $4 Billion;
